import React, {Component} from 'react';
import PropTypes from 'prop-types';

export default class TaskForm extends Component {

    alEnviar = (evento) => {
        evento.preventDefault();        
    }

    alCambiar = (evento) => {
        console.log(evento.target.value)
    }

    render () {
        return (
            <form onSubmit = {this.alEnviar}>
                <input type ="text" placeholder="Write a task" onChange = {alCambiar}/>
                <br />
                <br />
                <textarea placeholder="Write a description" onChange = {alCambiar}></textarea>
                <input type="submit" />
            </form>
        )        
    }

}
